class Solution {
public:
    long long maximumValueSum(vector<vector<int>>& b) {
        int n=b.size(),m=b[0].size();
        vector<vector<pair<long long,int>>> a(n);
        for(int i=0;i<n;i++){
        priority_queue<pair<int,int>>pq;
            for(int j=0;j<m;j++){
                pq.push({b[i][j],j});
            }
            for(int k=0;k<3;k++){
                a[i].push_back(pq.top());
                pq.pop();
            }
        }
        long long res=LLONG_MIN;
        for(int i=0;i<n-2;i++){
            for(int j=i+1;j<n-1;j++){
                for(int k=j+1;k<n;k++){

                    for(int x=0;x<3;x++){
                        for(int y=0;y<3;y++){
                            if(a[i][x].second==a[j][y].second)continue;
                            for(int z=0;z<3;z++){
                                if(a[i][x].second!=a[j][y].second && a[i][x].second!=a[k][z].second && a[j][y].second!=a[k][z].second){
                                    res=max(res,a[i][x].first+a[j][y].first+a[k][z].first);
                                }
                            }
                        }
                    }
                }
            }
        }
        return res;
    }
};
